import React from "react";
import { Link } from "react-router-dom";
import { useState, useEffect } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faCartShopping,
  faMagnifyingGlass,
  faUser,
  faBarsStaggered,
} from "@fortawesome/free-solid-svg-icons";

const Navbar = () => {
  return (
    <div className="black-nav">
      <div className="left">
        <FontAwesomeIcon icon={faUser} className="icons" />
      </div>
      <h1 className="center">
        <Link to="/">
          <img src="logo.png" width={40} height={60} className="logo"></img>
        </Link>
      </h1>
      <div className="right">
        <FontAwesomeIcon icon={faMagnifyingGlass} className="icons" />
        <Link to="/cart">
          <FontAwesomeIcon icon={faCartShopping} className="icons" />
        </Link>
        <FontAwesomeIcon icon={faBarsStaggered} className="icons" />
      </div>
    </div>
  );
};

export default Navbar;
